import React from 'react';

const customers = [
    {
        "id": 1,
        "firstName": "Cally",
        "lastName": "Reynolds",
        "emailAddress": "penatibus.et@lectusa.com",
        "phoneNumber": "(901) 166-8355",
        "address": "556 Lakewood Park, Bismarck, ND 58505"
    },
    {
        "id": 2,
        "firstName": "Sydney",
        "lastName": "Bartlett",
        "emailAddress": "nibh@ultricesposuere.edu",
        "phoneNumber": "(982) 231-7357",
        "address": "4829 Badeau Parkway, Chattanooga, TN 37405"
    }];

const Customers = () => {
    return (
        <table>
            <thead>
                <th>ID</th>
                <th>First Name</th>
                <th>Last Name</th>
                <th>Email Address</th>
                <th>Phone Number</th>
                <th>Address</th>
            </thead>
            <tbody>
                {customers.map(customer => {
                    const {
                        customerId,
                        firstName,
                        lastName,
                        emailAddress,
                        address
                    } = customer;
                    return (
                        <tr key={ customerId} >
                            <td>{customerId}</td>
                            <td>{firstName}</td>
                            <td>{lastName}</td>
                            <td>{emailAddress}</td>
                            <td>{phoneNumber}</td>
                            <td>{address}</td>
                        </tr>
                    )
                })}
            </tbody>
        </table>
    )
}

export default Customers;
